import { useEffect, useState } from "react";
import { allMoney } from "../../share/Money";
import style from "./Body.module.css"
function Body() {
  const [moneyList, setMoney] = useState([]);
  useEffect(() => {
    const makeMoney = async () => {
      try {
        console.log("askdkfskd");
        const result = await allMoney();
        setMoney(result);
      } catch (error) {
        console.log(error);
      }
    };
    makeMoney();
  }, []);
  console.log(moneyList);
  return (
    <div className="Wrapper">
        <ul className={style.header}>
            <li className={style.itemHeader}>Название</li>
            <li className={style.itemHeader}>Дата</li>
            <li className={style.itemHeader}>Описание</li>
            <li className={style.itemHeader}>Важность</li>
            <li className={style.itemHeader}>Стоимость</li>
        </ul>
      <ul>
        {moneyList.map((el) => {
          return (
            <li key={el._id} className={style.moneyItem}>
              {" "}
              <div className={style.itemHeader}>{el.name}</div>
              <div className={style.itemHeader}>{el.date.substr(0,10)}</div>
              <div className={style.description}>{el.description}</div>
              <div className={style.itemHeader}>{el.importance}</div>
              <div className={style.itemHeader}>{el.value}</div>{" "}
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default Body;
